(1, 5, 1, 'Brushed Your Dogs Fur Daily', 4, 'Prevents mats and reduces shedding.', 'https://lila-loves-it.com/en/magazine/brushing-dogs-why-it-is-so-important/\r\n', 'Use a suitable brush to remove loose hair and prevent tangles. This keeps your dog comfortable, prevents skin irritation, and helps detect lumps or skin issues early.', 2, '2025-11-18 14:46:13', '2025-11-17 11:53:28', 0),
(2, 5, 1, 'Trim Your Cats Nails Weekly', 1, 'Avoids scratching injuries.', 'https://www.petmd.com/news/view/how-often-should-you-trim-cats-nails-37807', 'Use cat-specific nail clippers. Gently trim the sharp tips, avoid the quick, and reward your cat afterwards. Regular trimming keeps them safe and prevents furniture damage.', 2, '2025-11-18 14:46:13', '2025-11-18 15:35:02', 0),
(4, 5, 1, 'Give 30-Minute Walks Daily', 1, 'Keeps your dog healthy and active.', 'https://vcahospitals.com/know-your-pet/the-benefits-of-walking-your-dog', 'Walk your dog twice a day or a single 30-minute session. Walking supports physical fitness, reduces anxiety, and strengthens the bond with your pet.', 2, '2025-11-18 14:46:13', '2025-11-18 15:37:42', 0),
(5, 5, 3, 'Offer Fresh Water Multiple Times a Day', 1, 'Prevents dehydration.', 'https://www.wellnesspetfood.com/blog/how-often-should-you-change-your-pets-water/', 'Change your pet\'s water 23 times daily. Clean bowls thoroughly to avoid bacteria. Proper hydration keeps pets energetic and prevents kidney and urinary issues.', 2, '2025-11-18 14:46:13', '2026-02-28 01:11:01', 1),
(6, 5, 4, 'Feed Measured Portions', 2, 'Controls weight and digestion.', 'https://www.northpointpets.com/whyaccuratelymeasuringyourpetsfoodisessential/', 'Use a measuring cup to feed your pet appropriate portions based on age, size, and activity level. Avoid free-feeding. Consult your vet for dietary adjustments if needed.', 3, '2025-11-18 14:46:13', '2026-02-28 13:27:23', 0),
(7, 5, 1, 'Use Puzzle Toys to Stimulate Your Pet', 1, 'Keeps their mind sharp.', 'https://vmc.vet.osu.edu/sites/default/files/documents/behavioral-med-puzzle-toys-2024.pdf', 'Introduce treat puzzles, hide-and-seek games, or interactive toys. Mental stimulation prevents boredom, improves behavior, and strengthens your bond.', 2, '2025-11-18 14:46:13', '2026-02-25 15:48:22', 0),
